import React from 'react';
import { Button } from '../../components/Button';

export const Login = () => {
    return (
        <div className="flex items-center justify-center ">
            <p className="text-2xl font-medium p-5">Sign In</p>
            <div className="flex flex-col justify-center items-start rounded-2xl border-2 border-neutral-300 max-w-3xl m-40 p-8 shadow-xl">
                <label className="flex items-start">Email adress</label>
                <input
                    placeholder="Enter email"
                    className="rounded-xl border-2 border-neutral-300 p-1 mb-2"
                ></input>
                <label>Password</label>
                <input
                    placeholder="Password"
                    className="rounded-xl border-2 border-neutral-300 p-1"
                ></input>
                <div className="w-full">
                    <Button
                        background="bg-indigo-600"
                        content={'Submit'}
                    ></Button>
                </div>

                <p>
                    Forgot <a className="">password?</a>
                </p>
            </div>
        </div>
    );
};
